import React, { useState } from 'react';

import './ButtonGenerateChapters.css'
import { linkApi } from '../config';

import funcPostSimple from '../utilities/fetchSimple';

const ButtonGenerateChapters = () => {

  const link = `${linkApi}/generateChapters`


  const handleListarClick = async () => {

    const response = await funcPostSimple(link);

    alert(response)
  }

  return (
    <div className="formulario-container">
      <h2>Generar Capitulos</h2>
      <form>
        <button className='button-generateChapters' type="button" onClick={handleListarClick}>Generar</button>
      </form>
    </div>
  );
}

export default ButtonGenerateChapters;
